From growing up in Maine to living in Georgia, we found our childhood haven in these Blue Ridge Glamping domes! 🌲✨ Reminiscent of weekends at our grandparent’s one room Hogan. This dome has everything. A beautiful waterfall view, hiking trails, cozy and comfortable atmosphere, a hot tub and fire pit right on your porch, tree weaves, hammocks, and so much more! We relaxed, played games and felt right at home in our little dome for the week. Who’s up for a glamping getaway here? It’s only 1.5 hours from Atlanta - so tag your adventure buddy! 🏕️🔥
